import React, { useEffect, useState } from "react"
import { BrowserRouter as Router, Route, Switch } from "react-router-dom"

import Splash from "/home/ubuntu/dev/src/pages/splash/Splash.js"
import Access from "/home/ubuntu/dev/src/pages/access/js/Access.js"
import Frontpage from "/home/ubuntu/dev/src/pages/frontpage/js/Frontpage.js"

export default function CustomRoutes() {

  const [loggedIn, setLoggedIn] = useState( false )
  useEffect( () => {
    loggedIn && console.log( "Logged in successfully" )
  }, [loggedIn] )

  return (
    <Router>
      <Switch>
        {/* <ProtectedRoute exact path="/" loggedIn={loggedIn} />
        <ProtectedRoute exact path="/access" setLoggedIn={() => setLoggedIn()} />
        <ProtectedRoute exact path="/frontpage" loggedIn={loggedIn} /> */}
        <Route exact path="/">
          <Splash setLoggedIn={() => { setLoggedIn() }} />
        </Route>
        <Route path="/access" >
          {
            loggedIn ?
              <Route path="/frontpage">
                <Frontpage />
              </Route> :
              <Access />
          }
        </Route>
      </Switch>
    </Router>
  )
}
